    [],nt"revision_timestamp": "2016-07-27T22:44:46.816519",nt"name": "snowshoe-hare-pellet-counts-tetlin-national-wildlife-refuge-eastern-alaska",nt"isopen":
    false,nt"url": null,nt"notes": "Snowshoe hares (Lepus americanus) are a
    keystone herbivore in the boreal forests of Canada and Alaska, and are cyclical
    over an approximately 8 to 11 year period. Monitoring hare populations can provide
    predictive information for other species. We monitored snowshoe hare abundance and
    trend during two time periods (1990-1994 and 2000-2004) at permanent pellet transects
    within the Tetlin National Wildlife Refuge (Tetlin Refuge) in eastern Alaska. Data
    gathered during 1990-1994 coincided with other information suggesting the population
    density peaked in 1990-1991; results from the 2000-2004 time period did not demonstrate
    a similar pattern. Recommendations are made for future survey efforts.",nt"license_title":
